import React from "react";

import { WishlistButtonContainer } from "./wishlist-icon.styles";
import { ReactComponent as HeartIcon } from "../../assets/wishlist.svg";
import { ReactComponent as HeartIconColored } from "../../assets/wishlist-colored.svg";

const WishListIcon = ({ ...otherProps }) => {
  return (
    <WishlistButtonContainer {...otherProps}>
      {this.state.inWishlist ? <WishListIconColored /> : <WishListIcon />}
    </WishlistButtonContainer>
  );
};

export default WishListIcon;
